import React, { useState, useEffect } from 'react';

const RangeSlider = ({ min, max, step, initialValue }) => {
  const [value, setValue] = useState(initialValue || min);
  const [inputValue, setInputValue] = useState(initialValue || min);

  useEffect(() => {
    const validInitialValue = Math.max(min, Math.min(max, roundToNearestMultipleOf10(initialValue || min)));
    setValue(validInitialValue);
    setInputValue(validInitialValue);
  }, [min, max, initialValue]);

  const roundToNearestMultipleOf10 = (num) => {
    return Math.round(num / 10) * 10;
  };

  const handleSliderChange = (e) => {
    const newValue = parseInt(e.target.value, 10);
    setValue(newValue);
    setInputValue(newValue);
  };

  const handleInputChange = (e) => {
    setInputValue(e.target.value);
  };

  const handleInputBlur = () => {
    let newValue = parseInt(inputValue, 10);

    if (isNaN(newValue)) {
      newValue = value;
    } else {
      newValue = Math.max(min, Math.min(max, roundToNearestMultipleOf10(newValue)));
    }

    setValue(newValue);
    setInputValue(newValue);
  };

  return (
    <div style={{ width: '100%', position: 'relative', padding: '20px' }}>
      <label style={{ fontWeight: 'bold', marginBottom: '10px', display: 'block' }}>Loan Amount</label>
      <div style={{
        position: 'absolute',
        top: '-30px',
        left: `${((value - min) / (max - min)) * 100}%`,
        transform: 'translateX(-50%)',
        backgroundColor: '#f5f5f5',
        borderRadius: '8px',
        padding: '5px 10px',
        boxShadow: '0 2px 5px rgba(0, 0, 0, 0.1)',
        fontWeight: 'bold',
      }}>
        ₹{value.toLocaleString()}
      </div>
      <input
        type="range"
        min={min}
        max={max}
        step={step}
        value={value}
        onChange={handleSliderChange}
        style={{ width: '100%', margin: '20px 0' }}
      />
      <div style={{ display: 'flex', justifyContent: 'space-between', marginTop: '8px' }}>
        <span>₹{min.toLocaleString()}</span>
        <span>₹{max.toLocaleString()}</span>
      </div>
      <input
        type="number"
        value={inputValue}
        step={step}
        onChange={handleInputChange}
        onBlur={handleInputBlur}
        style={{ marginLeft: '10px', position: 'absolute', right: 0, top: '0', display: 'none' }}
      />
    </div>
  );
};

export default RangeSlider;
